import axios from 'axios';

const fetchData = async () => {
    try {      
        const res = await axios.get('https://api.weebly.com/v1/user/sites/987654321/store/categories')
        // const categories = res.json()

        return {
            props: {
                "categories":67,
            },
        }
    }
    catch (e) {
        console.log('Error',e)
    }
}

export default fetchData;
